/**
 * Sets the default function variables used by lengthNorm when no field
 * specifc variables have been set.
 *
 * @see #lengthNorm
 */
public void setLengthNormFactors(int min, int max, float steepness) {
  this.ln_min = min;
  this.ln_max = max;
  this.ln_steep = steepness;
}

